// function to check if a set of points forms a golden rectangle
function f_gold(points) {
    // initialize minimum and maximum x values to infinity and negative infinity respectively
    var min_x = Number.POSITIVE_INFINITY;
    var max_x = Number.NEGATIVE_INFINITY;
    // create a set to store unique points
    var point_set = new Set();
    // loop through each point in the array
    for (var i = 0; i < points.length; i++) {
        var x = points[i][0];
        var y = points[i][1];
        // update minimum and maximum x values
        min_x = Math.min(min_x, x);
        max_x = Math.max(max_x, x);
        // add point to set
        point_set.add(String([x, y]));
    }
    // calculate the sum of minimum and maximum x values
    var s = min_x + max_x;
    // loop through each point in the array again
    for (var i = 0; i < points.length; i++) {
        var x = points[i][0];
        var y = points[i][1];
        // check if the set contains the reflection of the point across the vertical axis passing through the center of the rectangle
        if (!point_set.has(String([s - x, y]))) {
            return false;
        }
    }
    // if all points have a reflection in the rectangle, return true
    return true;
}
